	  merge_msg_mesos_state_agentinfo(Prev, New, TrUserData);
      #mesos_state_networkconfig{} ->
	  merge_msg_mesos_state_networkconfig(Prev, New,
					      TrUserData);
      #mesos_state_state{} ->
	  merge_msg_mesos_state_state(Prev, New, TrUserData)
